import React from "react";
import classnames from 'classnames'

import styles from './Header.module.sass'

const Header = () => {
  const down = (evt, id) => {
    evt.preventDefault();
    document.getElementById(id).scrollIntoView({
      behavior: "smooth",
      block: "start",
    });
  };

  return (
    <div className={classnames(styles["header"], styles["center"])}>
      <figure>
        <img
          className={styles["img"]}
          src="~static/perfil.jpg"
          alt="Luis Ángel Vásquez Nepomuceno"
        />
      </figure>
      <div className={styles["botones"]}>
        <a
          className={styles["btn-link"]}
          href="#proyects"
          onClick={event => down(event, 'proyects')}
        >
          Proyectos
        </a>
        <a
          className={styles["btn-link"]}
          href="#contacto"
          onClick={event => down(event, 'contacto')}
        >
          Contacto
        </a>
      </div>
    </div>
  );
};

export default Header;
